import React from 'react';
import {Link} from "react-router-dom";

const MainPage = () => {
    return (
        <div>
            <ul>
                <li>
                    <Link to="/profileCard">Page One</Link>
                </li>
                <li>
                    <Link to="/CitySkyline">Page Two</Link>
                </li>
            </ul>
        </div>
    );
};

export default MainPage;
